import DialogItem from "../Message/DialogItem/DialogsItem";


function Users(props) {
    let state = props.usersPage
    let usersElements = state.users.map(ue => <div> key={ue.id} name={ue.name}  location = {ue.location} descriptionProfile={ue.descriptionProfile} </div>)
    return(
        <div>
            {usersElements}
        </div>
    )
}

export default Users;
